CREATE TABLE population 
(
    Name	VARCHAR(512),
    GENC	VARCHAR(512),
    Year	INT,
    Population	VARCHAR(512)
);


use population;

-- Total population by Year
SELECT Year, SUM(Population) AS "Population"
FROM population
GROUP BY Year;

SELECT 
	Name
	, Year
	, SUM(Population) AS "Population"
FROM population 
GROUP BY Name, Year
;

-- Form A
SELECT Name
	, Year
	, Population 
FROM population
WHERE Year = "1950"
;

-- Form B (A way fo unpivoting)
/* To use UNION ALL the data type of all columns must be the same */

SELECT Name
	, "2020" AS "YEAR"
	, Population
FROM population
	UNION ALL
SELECT Name
	, "2023" AS "YEAR"
	, Population
FROM population
ORDER BY Year DESC
;

/*SELECT Year, COUNT(DISTINCT Year) AS "Year Counting" FROM population
GROUP BY Year;*/

